import './TodoItem.css';
import { Col, Row } from 'react-bootstrap';

function TodoItem({todo, onDelete}) {
    return (

        <div className='box'>
            <Row>
                <Col><img className='Todo-check' src="../Assests/circle.png" alt="" fluid/></Col>
                <Col><p className='Todo-text'>{todo.text}</p></Col>
                <Col><img className='Todo-cancel' src="../Assests/icon-cross.svg" alt="" onClick={() => onDelete(todo.id)}/></Col>
            </Row>
        </div>

    );
}

export default TodoItem;
